import React from 'react'
import {Link} from 'react-router-dom';

function Dashboard() {
    return (
        <div className = 'flex'>
            <Link className='text-center items-center bg-black text-white p-4' to = '/addproducto'>Agregar Producto</Link>

        </div>
    )
}

export default Dashboard
